var dx = [-1, -1, -1, 0, 0, 1, 1, 1];
var dy = [0, -1, 1, -1, 1, -1, 0, 1];

var Board = new Array(20);
for(let i =0;i<20;i++){
    Board[i] = new Array(51);
    for(let j=0;j<51;j++){
        Board[i][j] = false;
    }
}
var timer = 100;
function fill(i, j,pre_i,pre_j) {
    setTimeout(function () {
        let x = pre_i + 10;
        let y = pre_j + 10;
        document.getElementById(x + "" + y).classList.remove("cur");
        document.getElementById(x + "" + y).classList.add("abc");
        x = i+10; y = j + 10;
        document.getElementById(x+"" +y).classList.add("cur");
    },timer);
}
function dfs(sx,sy,ex,ey){

    Board[sx][sy] = true;
    timer += 10;

    if(sx === ex && sy === ey){
        return true;
    }

    console.log(sx + " " + sy);

    for(let k=0;k<8;k++){
        let nx = sx + dx[k];
        let ny = sy + dy[k];

        if(nx <= 20 && nx >= 0 && ny <= 50 && ny >= 0){
            if(Board[nx][ny] === false){
                fill(nx,ny,sx,sy);
                let t = dfs(nx, ny, ex, ey);
                if (t === true) {
                    return true;
                }
            }
        }
    }
    return false;

}
document.getElementById("2022").classList.add("end");
